   const [characters, setCharacters] = useState([]);

   function onSearch() {
      setCharacters([ ...characters, example]);
   }

   return (
      <div className='App'>
         <Nav onSearch={onSearch}/>
         <Cards characters={characters} />
      </div>
   );
}

export default App;
